						["custom_type"] = "status",
						["custom"] = "function()\n    \n    if isAuraHighestPriority == nil then return false end    \n    \n    --Casting\n    if coolDown.cast.name ~= nil and (coolDown.cast.name == \"Fireball\" or coolDown.cast.name == \"Scorch\")\n    then\n        myActions[\"Fireball\"].casting.active = true\n        myActions[\"Fireball\"].casting.expirationTime = coolDown.cast.expirationTime        \n    else\n        myActions[\"Fireball\"].casting.active = false\n        myActions[\"Fireball\"].casting.expirationTime = nil\n    end \n    \n    --priority    \n    myActions[\"Fireball\"].priority = 11\n    \n    --Use any instant charges during Combustion first\n    if (myActions[\"Fire Blast\"].charges > 0 or myActions[\"Phoenix Flames\"].charges > 0)\n    and select(1,AuraUtil.FindAuraByName(\"Combustion\", \"player\", \"HELPFUL|PLAYER\"))     \n    then\n        myActions[\"Fireball\"].priority = nil\n    end    \n    \n    --return isAuraHighestPriority(\"Fireball\", myActions)\n    if highestPriority ~= nil and highestPriority.action == \"Fireball\"\n    then\n        return true        \n    end    \n    \nend\n\n\n\n\n\n\n",
