			["displayText_format_p_time_dynamic_threshold"] = 60,
			["customText"] = "function()\n    \n    if round == nil or highestPriority == nil or coolDown == nil or cFunction_UnitStrength == nil or cFunction_UnitStrength(\"target\") == nil then return false end\n    \n    local myActions = myActions\n    local mytext = \"Now: \"..tostring(round(GetTime(),1))..\" 100ms: \"..tostring(round(highestPriority.time,1))..\"\\n\"\n    ..\"GCD Expire: \"..tostring(coolDown.gcd.expirationTime)..\" Duration: \"..tostring(coolDown.gcd.duration)..\"\\n\"\n    ..\"Highest Priority: \".. tostring(highestPriority.action) ..\"\\n\"\n    ..\"Target Strength: \" .. cFunction_UnitStrength(\"target\") ..\"\\n\"\n    \n    local function getTableKeys(tab)\n        local keyset = {}\n        for k,v in pairs(tab) do            \n            \n            local p = \"nil\"\n            local r = \"nil\"\n            local cd = \"nil\" \n            local cdd = \"nil\"             \n            local cdov = \"nil\" \n            local cst = \"nil\"\n            if myActions[k].priority ~= nil then p = tostring(myActions[k].priority) end\n            if myActions[k].inRange ~= nil then r = tostring(myActions[k].inRange) end\n            if myActions[k].coolDown.expirationTime ~= nil then cd = tostring(round(myActions[k].coolDown.expirationTime,3)) end\n            if myActions[k].coolDown.duration ~= nil then cdd = tostring(round(myActions[k].coolDown.duration,1)) end                        \n            if myActions[k].casting.active ~= nil then cst = tostring(myActions[k].casting.active) end\n            \n            local mynext = tostring(isAuraHighestPriority(k, myActions))\n            \n            mytext = mytext..k..\"\\n           Priority: \"..p..\" InRange: \"..r            \n            ..\" Casting:\"..cst.. \" Next: \"..mynext..\" CoolDown: \"..cd..\" Duration: \"..cdd\n            ..\"\\n\"            \n        end\n    end\n    \n    local mysort = function(a,b)\n        return a.priority < b.priority\n    end\n    \n    if myActions ~= nil\n    then\n        table.sort(myActions, mysort )\n        getTableKeys(myActions)\n        return mytext    \n    end    \nend\n\n\n\n\n\n\n\n\n",
