			},
			["customText"] = "function()\n    \n    local voidFormState = WeakAuras.GetTriggerStateForTrigger(\"Void Bolt\", 5)\n    local powerState = WeakAuras.GetTriggerStateForTrigger(\"Void Bolt\", 6)\n    \n    if ((voidFormState[\"\"] ~= nil and voidFormState[\"\"].show) or myActions[\"Void Eruption\"].casting.active)\n    --and (powerState[\"\"] ~= nil and powerState[\"\"].show)\n    then\n        print(tostring(myActions[\"Void Bolt\"].coolDown.active)..\" \"..tostring(myActions[\"Void Bolt\"].coolDown.override)\n            ..\" \"..tostring(myActions[\"Mind Blast\"].coolDown.active)..\" \"..tostring(myActions[\"Mind Blast\"].coolDown.override))\n    end \n    \nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "update",
			["cooldownEdge"] = false,
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "--Checks to see if the given auraName is the Highest Priorty ability vrs all the other abilitys in the given actionTable\n--The action table must look like the following where the top level key is the aura name that set the other values\n--myActions[\"Frost Shock\"] = {\n--    [\"priority\"] = nil,\n--    [\"onCoolDown\"] = false,\n--    [\"expirationTime\"] = nil,\n--    [\"inRange\"] = nil     \n--}\n\nif highestPriority == nil\nthen\n    highestPriority = {\n        [\"time\"] = GetTime(),\n        [\"action\"] = nil        \n    }\nend\n\nfunction isAuraHighestPriority(auraName, actionTable) \n    \n    if actionTable == nil or actionTable[auraName] == nil then return false end\n    \n    local auraData = actionTable[auraName]\n    if auraData.priority == nil\n    then\n        return false\n    end        \n    \n    for iAuraName, iAuraData in pairs(actionTable) do\n        if iAuraName ~= auraName and iAuraData.priority ~= nil\n        then\n            --print(auraName..\" \"..iAuraName)                        \n            local isNext = isAuraHighestPriority_Comparator(auraData, iAuraData, auraName, iAuraName)                        \n            if not isNext\n            then  \n                return false\n            end                                    \n        end        \n    end    \n    \n    return true\nend\n\nfunction isAuraHighestPriority_Comparator(auraData, iAuraData, auraName, iAuraName)\n    -- Sort Order: inRange, expirationTime, priority \n    -- For inRange if Target is within 8m skip range sorting\n    if auraData.inRange and not iAuraData.inRange and WeakAuras.CheckRange(\"target\", 8, \">\")\n    then\n        return true\n    elseif not auraData.inRange and iAuraData.inRange and WeakAuras.CheckRange(\"target\", 8, \">\")\n    then\n        return false\n    else\n        if auraData.coolDown.expirationTime == iAuraData.coolDown.expirationTime \n        then\n            return auraData.priority < iAuraData.priority\n        end                \n        return auraData.coolDown.expirationTime < iAuraData.coolDown.expirationTime\n    end\nend        \n\nfunction dump(o)\n    if type(o) == 'table' then\n        local s = '{ '\n        for k,v in pairs(o) do\n            if type(k) ~= 'number' then k = '\"'..k..'\"' end\n            s = s .. '['..k..'] = ' .. dump(v) .. ','\n        end\n        return s .. '} '\n    else\n        return tostring(o)\n    end\nend\n\nfunction round(number, decimals)\n    return ((\"%%.%df\"):format(decimals)):format(number)\nend",
