						["custom"] = "function()\n    \n    if myActions == nil or highestPriority == nil then return false end\n    \n    local time = GetTime()\n    if time > highestPriority.time\n    then\n        highestPriority.time = time + (aura_env.config[\"auraUpdateInterval\"]/1000)\n        \n        for k,v in pairs(myActions) do            \n            \n            if isAuraHighestPriority(k, myActions)\n            then\n                highestPriority.action = k\n                if aura_env.config[\"debugTimer\"] \n                then \n                    print(highestPriority.action)\n                end\n                \n                return true\n            end            \n        end\n        \n    end            \nend",
