					["custom"] = "myActionsData = {\n    [\"flameShock\"] = {\n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    },\n    [\"lashingFlames\"] = {\n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    }        \n}\n\nif not unitsInMelee then\n    unitsInMelee = {\n        [\"units\"] = {},        \n        [\"count\"] = 0,    \n        [\"healthy\"] = 0,\n        [\"bosses\"] = 0,\n        [\"weak\"] = 0    \n    }\nend",
