						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["custom"] = "function()    \n    \n    --Min Enemey Health to make dot worthwhile, uses player health to simplify scaling\n    local playerMaxHealth = UnitHealthMax(\"player\")                             --Example 15000\n    local healthTreshhold_FlameShock = playerMaxHealth / 6                      --0.167    2550 \n    \n    \n    if GetNumSubgroupMembers() > 0\n    then\n        healthTreshhold_FlameShock = healthTreshhold_FlameShock * 8             --        20000             \n    end \n    \n    \n    --FlameShock\n    local countFlameShock_Missing = 0\n    local countFlameShock_Expiring = 0\n    local targetFlameShock_Missing = 0\n    local targetFlameShock_Expiring = 0\n    \n    --Lashing Flames\n    local countLashingFlames_Missing = 0\n    local countLashingFlames_Expiring = 0\n    local targetLashingFlames_Missing = 0\n    local targetLashingFlames_Expiring = 0\n    \n    --pandemic\n    local durationDlameShock = 18\n    local durationLashingFlames = 20\n    local pandemicFlameShock = durationDlameShock *.3\n    local pandemicLashingFlames = durationLashingFlames *.3\n    \n    local checkTarget = function(unit)\n        local target = false\n        if UnitExists(\"target\") and UnitGUID(\"target\") == UnitGUID(unit)\n        then\n            target = true\n        end                \n        local health = UnitHealth(unit)\n        local max_health = UnitHealthMax(unit);\n        \n        --Flame Shock--\n        if health >= healthTreshhold_FlameShock\n        then\n            do             \n                local name,_,_,_, duration, expirationTime,_,_,_,_,_,_,_,_,_ = AuraUtil.FindAuraByName(\"Flame Shock\", unit,\"HARMFUL|PLAYER\")\n                if not name\n                then                \n                    countFlameShock_Missing = countFlameShock_Missing + 1                           \n                    if target then targetFlameShock_Missing = 1 end                    \n                elseif expirationTime ~= nil and expirationTime - GetTime() <= pandemicFlameShock\n                then\n                    countFlameShock_Expiring = countFlameShock_Expiring + 1                                           \n                    if target then targetFlameShock_Expiring = 1 end\n                end\n            end        \n        end\n        \n        --Lashing Flames\n        do              \n            local name,_,_,_, duration, expirationTime,_,_,_,_,_,_,_,_,_ = AuraUtil.FindAuraByName(\"Lashing Flames\", unit,\"HARMFUL|PLAYER\")\n            if not name\n            then                \n                countLashingFlames_Missing = countLashingFlames_Missing + 1                           \n                if target then targetLashingFlames_Missing = 1 end                    \n            elseif expirationTime ~= nil and expirationTime - GetTime() <= pandemicLashingFlames\n            then\n                countLashingFlames_Expiring = countLashingFlames_Expiring + 1                                           \n                if target then targetLashingFlames_Expiring = 1 end\n            end            \n        end\n    end\n    \n    \n    --Always check target and then scan for others\n    if UnitExists(\"target\") and UnitCanAttack(\"player\", \"target\") and not UnitIsDead(\"target\")     \n    --and select(4,UnitDetailedThreatSituation(\"player\", \"target\")) ~= nil    \n    then\n        checkTarget(\"target\")\n    end\n    \n    --Use Targets identified in unitsInMelee aura instead of repeating code here\n    for unit,_ in pairs(unitsInMelee.units) do\n        if UnitGUID(\"target\") ~= UnitGUID(unit)\n        then            \n            checkTarget(unit)\n        end\n    end\n    \n    --legacy will remove\n    ----If alteast one unit in range then loop through all units and double check range\n    --if unitsInMelee.count ~= nil and unitsInMelee.count >= 1\n    --then        \n    --    for i = 1, 40 do\n    --        local unit = \"nameplate\"..i            \n    --        if UnitCanAttack(\"player\", unit) and WeakAuras.CheckRange(unit, 40, \"<=\")\n    --        and \n    --        (not UnitAffectingCombat(\"player\") \n    --            or (UnitAffectingCombat(\"player\") and UnitThreatSituation(\"player\", unit))\n    --            or (UnitExists(\"target\") and UnitGUID(\"target\") == UnitGUID(unit))\n    --        ) \n    --        then\n    --            checkTarget(unit)\n    --        end                \n    --    end                    \n    --elseif UnitExists(\"target\")\n    --then\n    --    checkTarget(\"target\")\n    --end\n    \n    \n    --FlameShock\n    myActionsData.flameShock.missing = countFlameShock_Missing   \n    myActionsData.flameShock.expiring = countFlameShock_Expiring\n    myActionsData.flameShock.target.missing = targetFlameShock_Missing\n    myActionsData.flameShock.target.expiring = targetFlameShock_Expiring\n    \n    --LashingFlames\n    myActionsData.lashingFlames.missing = countLashingFlames_Missing   \n    myActionsData.lashingFlames.expiring = countLashingFlames_Expiring\n    myActionsData.lashingFlames.target.missing = targetLashingFlames_Missing\n    myActionsData.lashingFlames.target.expiring = targetLashingFlames_Expiring    \n    \n    \n    return true\n    \nend",
