				["init"] = {
					["do_custom"] = true,
					["custom"] = "myEnergy = {}\n\ncFunction_GetEnergyCoolDowns = function(req_energey) \n    \n    local energy = UnitPower(\"player\",2)\n    \n    if energy >= req_energey\n    then\n        myEnergy[req_energey] = {\n            [\"duration\"] = 0,\n            [\"expirationTime\"] = 0\n        }        \n        \n        return 0,0\n    end\n    \n    if myEnergy[req_energey] ~= nil and myEnergy[req_energey].expirationTime < GetTime()\n    then\n        myEnergy[req_energey] = {\n            [\"duration\"] = 0,\n            [\"expirationTime\"] = 0\n        }\n    end\n    \n    if myEnergy[req_energey] == nil\n    then        \n        cFunction_CalEnergyCoolDowns(req_energey, energy)        \n    end  \n    \n    --print(\"Duration: \"..myEnergy[req_energey].duration..\" Expire: \"..myEnergy[req_energey].expirationTime)\n    \n    --Add .4s to deal with timing oddness\n    return myEnergy[req_energey].duration + .4, myEnergy[req_energey].expirationTime + .4\nend\n\ncFunction_CalEnergyCoolDowns = function(req_energey, energy) \n    \n    if energy >= req_energey\n    then\n        myEnergy[req_energey] = {\n            [\"duration\"] = 0,\n            [\"expirationTime\"] = 0\n        }        \n    else\n        local regen = GetPowerRegen()\n        local duration = req_energey / regen        \n        \n        local expirationTime = ((req_energey - energy) / regen) + GetTime()\n        \n        myEnergy[req_energey] = {\n            [\"duration\"] = duration,\n            [\"expirationTime\"] = expirationTime\n        }           \n    end        \nend",
				},
