						["custom"] = "function()\n    \n    if cFunction_HasTalent == nil then return false end\n    \n    local Carve_or_Butchery = cFunction_HasTalent(\"Carve\") \n    \n    --coolDown        \n    myActions[\"Carve\"].coolDown.duration = 0\n    myActions[\"Carve\"].coolDown.expirationTime = 0 \n    myActions[\"Carve\"].charges = nil\n    \n    local req_energy = 30\n    if Carve_or_Butchery then req_energy = 35 end    \n    \n    local coolDownDuration_Focus = 0 \n    local coolDownExpirationTime_Focus = 0\n    local energy = UnitPower(\"player\",2)\n    if energy < req_energy\n    then \n        coolDownDuration_Focus, coolDownExpirationTime_Focus = cFunction_GetEnergyCoolDowns(req_energy)        \n    end      \n    \n    local coolDownStart, coolDownDuration, coolDownExpirationTime, currentCharges, maxCharges\n    if Carve_or_Butchery\n    then\n        coolDownStart, coolDownDuration, _, _ = GetSpellCooldown(\"Carve\")\n        coolDownExpirationTime = coolDownStart + coolDownDuration\n    else\n        currentCharges, maxCharges, coolDownStart, coolDownDuration, _ = GetSpellCharges(\"Butchery\")                     \n        \n        --If cool down is going to recover before gcd does count as full charges\n        if currentCharges < maxCharges and coolDownStart + coolDownDuration <= coolDown.gcd.expirationTime and coolDownStart < 4290000\n        then\n            currentCharges  = currentCharges + 1 \n        end\n        \n        if coolDownStart < 4290000  then coolDownExpirationTime = coolDownStart + coolDownDuration else coolDownExpirationTime = 0 end  \n        \n        myActions[\"Carve\"].charges = currentCharges\n    end\n    \n    if (currentCharges == nil or currentCharges == 0)\n    and (coolDownExpirationTime > coolDownExpirationTime_Focus and coolDownExpirationTime > coolDown.gcd.expirationTime)\n    then\n        myActions[\"Carve\"].coolDown.duration = coolDownDuration\n        myActions[\"Carve\"].coolDown.expirationTime = coolDownExpirationTime\n    elseif coolDownExpirationTime_Focus > coolDown.gcd.expirationTime\n    then\n        myActions[\"Carve\"].coolDown.duration = coolDownDuration_Focus\n        myActions[\"Carve\"].coolDown.expirationTime = coolDownExpirationTime_Focus\n    end        \n    \n    --priority\n    myActions[\"Carve\"].priority = nil\n    \n    if unitsInMelee.count > 1 \n    then\n        -- If i have talent Frenzy Strikes i want to make sure i don't waste the cd reduction for bombs unless i'm have maxCharges of Butchery\n        if not cFunction_HasTalent(\"Frenzy Strikes\") \n        then\n            myActions[\"Carve\"].priority = 7\n        elseif currentCharges == nil or currentCharges == maxCharges\n        then\n            myActions[\"Carve\"].priority = 7\n        else            \n            local frenzyStrikes_Reduction\n            if unitsInMelee.count <= 5 then frenzyStrikes_Reduction = unitsInMelee.count else frenzyStrikes_Reduction = 5 end\n            if frenzyStrikes_Reduction < myActions[\"Wildfire Bomb\"].coolDown.remaining\n            then\n                myActions[\"Carve\"].priority = 7\n            end\n        end    \n    end    \n    \n    if highestPriority ~= nil and highestPriority.action == \"Carve\"\n    then\n        return true        \n    end    \nend",
