		["Shadow Multi Target Tracker"] = {
			["iconSource"] = 0,
			["authorOptions"] = {
			},
			["customText"] = "function()    \n    if myActionsData ~= nil\n    then\n        \n        return\n        \"---Devouring Plaque---\" \n        .. \"\\nSkip: \" .. myActionsData.devouringPlague.skip\n        .. \"\\nTarget: \" .. myActionsData.devouringPlague.target\n        ..\n        \"\\n---Shadow Word Death---\"   \n        .. \"\\nCount: \" .. myActionsData.shadowWordDeath.count\n        .. \"\\nTarget: \" .. myActionsData.shadowWordDeath.target\n        ..        \n        \"\\n---Shadow Word Pain---\"   \n        .. \"\\nMissing: \" .. myActionsData.shadowWordPain.missing        \n        .. \"\\nExpiring: \" .. myActionsData.shadowWordPain.expiring        \n        .. \"\\nTaret Missing: \" .. myActionsData.shadowWordPain.target.missing\n        .. \"\\nTarget Expiring: \" .. myActionsData.shadowWordPain.target.expiring\n        ..\n        \"\\n---Vampiric Touch---\"               \n        .. \"\\nMissing: \" .. myActionsData.vampiricTouch.missing        \n        .. \"\\nExpiring: \" .. myActionsData.vampiricTouch.expiring        \n        .. \"\\nTaret Missing: \" .. myActionsData.vampiricTouch.target.missing\n        .. \"\\nTarget Expiring: \" .. myActionsData.vampiricTouch.target.expiring \n    end    \nend",
			["yOffset"] = 2.5999755859375,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "update",
			["cooldownEdge"] = false,
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "myActionsData = {\n    [\"devouringPlague\"] = {    \n        [\"skip\"] = 0,\n        [\"target\"] = 0\n    },\n    [\"shadowWordDeath\"] = {\n        [\"count\"] = 0,\n        [\"target\"] = 0\n    },    \n    [\"shadowWordPain\"] = {\n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    },\n    [\"vampiricTouch\"] = {        \n        [\"missing\"] = 0,\n        [\"expiring\"] = 0,\n        [\"target\"] = {\n            [\"missing\"] = 0,\n            [\"expiring\"] = 0\n        }\n    }    \n}\n\nif not unitsInRange then\n    unitsInRange = {\n        [\"units\"] = {},\n        [\"count\"] = 0,    \n        [\"healthy\"] = 0,\n        [\"bosses\"] = 0,\n        [\"weak\"] = 0    \n    }\nend",
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["custom"] = "function() \n    \n    if cFunction_HasTalent == nil or cFunction_UnitStrength == nil then return false end\n    \n    --Min Enemey Health to make dot worthwhile, uses player health to simplify scaling\n    local spellPower = GetSpellBonusDamage(6)\n    local playerMaxHealth = UnitHealthMax(\"player\")                             \n    local healthTreshhold_devouringPlague = playerMaxHealth / 6                 \n    local healthTreshhold_shadowWordPain = playerMaxHealth / 6                  \n    local healthTreshhold_vampiricTouch = playerMaxHealth / 6                   \n    \n    if GetNumSubgroupMembers() > 0\n    then\n        healthTreshhold_devouringPlague = healthTreshhold_devouringPlague * 4        \n        healthTreshhold_shadowWordPain = healthTreshhold_shadowWordPain * 4     \n        healthTreshhold_vampiricTouch = healthTreshhold_vampiricTouch * 4       \n    end \n    \n    --DevouringPlaque\n    local countDevouringPlague_Skip = 0    \n    local unitsDevouringPlague_Health = {}\n    --ShadowWordPain\n    local countShadowWordDeath = 0\n    local targetShadowWordDeath = 0    \n    --ShadowWordPain\n    local countShadowWordPain_Missing = 0\n    local countShadowWordPain_Expiring = 0\n    local targetShadowWordPain_Missing = 0\n    local targetShadowWordPain_Expiring = 0\n    --VampiricTouch\n    local countVampiricTouch_Missing = 0\n    local countVampiricTouch_Expiring = 0\n    local targetVampiricTouch_Missing = 0\n    local targetVampiricTouch_Expiring = 0\n    \n    --pandemic\n    local devouringPlague_duration = 6\n    local shadowWordPain_duration = 16\n    local vampiricTouch_duration = 21\n    \n    if cFunction_HasTalent(\"Misery\")\n    then\n        shadowWordPain_duration = shadowWordPain_duration + 5\n    end    \n    \n    local devouringPlague_pandemic = devouringPlague_duration *.3\n    local shadowWordPain_pandemic = shadowWordPain_duration *.3\n    local vampiricTouch_pandemic = vampiricTouch_duration *.3    \n    \n    local checkTarget = function(unit)\n        local target = false\n        if UnitExists(\"target\") and UnitGUID(\"target\") == UnitGUID(unit)\n        then\n            target = true\n        end                \n        local health = UnitHealth(unit)\n        local max_health = UnitHealthMax(unit)\n        local strength = cFunction_UnitStrength(unit)\n        \n        --Devouring Plague--\n        do            \n            if strength ~= \"Weak\" and health > healthTreshhold_devouringPlague then\n                unitsDevouringPlague_Health[UnitGUID(unit)] = health\n            else\n                countDevouringPlague_Skip = countDevouringPlague_Skip + 1\n            end\n        end\n        \n        --Shadow Word Death--\n        if health < (max_health / 5) \n        -- .85 * Intell * hidden 10% damage buff\n        or health < spellPower * .85 * 1.1\n        then\n            countShadowWordDeath = countShadowWordDeath + 1\n            if target then targetShadowWordDeath = 1 end                       \n        end                \n        \n        --Shadow Word Pain--\n        if health >= healthTreshhold_shadowWordPain -- and strength ~= \"Weak\" --Can't Cleave without vt\n        then\n            do             \n                local name, icon, count, debuffType, duration, expirationTime, unitCaster, canStealOrPurge, nameplateShowPersonal, spellId, canApplyAura, isBossDebuff, isCastByPlayer, nameplateShowAll, timeMod = AuraUtil.FindAuraByName(\"Shadow Word: Pain\", unit, \"HARMFUL|PLAYER\")\n                if not name\n                then                \n                    countShadowWordPain_Missing = countShadowWordPain_Missing + 1                           \n                    if target then targetShadowWordPain_Missing = 1 end                    \n                elseif expirationTime ~= nil and expirationTime - GetTime() <= shadowWordPain_pandemic\n                then\n                    countShadowWordPain_Expiring = countShadowWordPain_Expiring + 1                                           \n                    if target then targetShadowWordPain_Expiring = 1 end\n                end\n            end        \n        end\n        \n        --VampiricTouch--\n        if strength ~= \"Weak\" and health >= healthTreshhold_shadowWordPain\n        then\n            do             \n                local name, icon, count, debuffType, duration, expirationTime, unitCaster, canStealOrPurge, nameplateShowPersonal, spellId, canApplyAura, isBossDebuff, isCastByPlayer, nameplateShowAll, timeMod = AuraUtil.FindAuraByName(\"Vampiric Touch\", unit, \"HARMFUL|PLAYER\")\n                if not name\n                then                \n                    countVampiricTouch_Missing = countVampiricTouch_Missing + 1                           \n                    if target then targetVampiricTouch_Missing = 1 end                    \n                elseif expirationTime ~= nil and expirationTime - GetTime() <= vampiricTouch_pandemic\n                and (unitsInRange.count <= 2 or expirationTime < myActions[\"Shadow Crash\"].coolDown.expirationTime + 1.5)\n                then\n                    countVampiricTouch_Expiring = countVampiricTouch_Expiring + 1                                           \n                    if target then targetVampiricTouch_Expiring = 1 end\n                end\n            end        \n        end                 \n    end   \n    \n    --Always check target and then scan for others\n    if UnitExists(\"target\") and UnitCanAttack(\"player\", \"target\") and not UnitIsDead(\"target\")     \n    --and select(4,UnitDetailedThreatSituation(\"player\", \"target\")) ~= nil    \n    then\n        checkTarget(\"target\")\n    end\n    \n    --Use Targets identified in unitsInMelee aura instead of repeating code here\n    for unit,_ in pairs(unitsInRange.units) do\n        if UnitGUID(\"target\") ~= UnitGUID(unit)\n        then            \n            checkTarget(unit)\n        end\n    end\n    \n    --legacy will remove\n    --for i = 1, 40 do\n    --    local unit = \"nameplate\"..i            \n    --    if WeakAuras.CheckRange(unit, range, \"<=\")\n    --    and UnitCanAttack(\"player\", unit) and not UnitIsDead(unit)\n    --    and (select(4,UnitDetailedThreatSituation(\"player\", unit)) ~= nil and (UnitGUID(\"target\") ~= UnitGUID(unit)))\n    --    and not string.match(select(1,UnitName(unit), \"Totem\")) and not string.match(select(1,UnitName(unit), \"totem\"))        \n    --    then\n    --        checkTarget(unit)\n    --    end                \n    --end        \n    \n    \n    --DevouringPlaque\n    myActionsData.devouringPlague.skip = countDevouringPlague_Skip\n    \n    local target_MostHealth = 0\n    --Find Target with most health to make sure we get as much self healing out of Devouring Plaque as possible\n    if countDevouringPlaque_Skip ~= unitsInRange.count\n    then\n        --print(\"Begin\")\n        local unit\n        local health\n        for k,v in pairs(unitsDevouringPlague_Health) do\n            --print(k..\" \"..v)\n            if unit == nil\n            then\n                unit = k\n                health = v                \n            elseif v > health\n            then\n                unit = k\n                health = v\n            elseif v == health\n            then\n                unit = nil\n                health = nill                \n            end    \n        end\n        if unit ~= nil and unit == UnitGUID(\"target\") \n        then\n            target_MostHealth = 1\n        else\n            target_MostHealth = 0\n        end        \n    end    \n    myActionsData.devouringPlague.target = target_MostHealth\n    \n    --ShadowWordDeath\n    myActionsData.shadowWordDeath.count = countShadowWordDeath\n    myActionsData.shadowWordDeath.target = targetShadowWordDeath\n    \n    --ShadowWordPain\n    myActionsData.shadowWordPain.missing = countShadowWordPain_Missing   \n    myActionsData.shadowWordPain.expiring = countShadowWordPain_Expiring\n    myActionsData.shadowWordPain.target.missing = targetShadowWordPain_Missing\n    myActionsData.shadowWordPain.target.expiring = targetShadowWordPain_Expiring\n    \n    --VampiricTouch\n    myActionsData.vampiricTouch.missing = countVampiricTouch_Missing        \n    myActionsData.vampiricTouch.expiring = countVampiricTouch_Expiring    \n    myActionsData.vampiricTouch.target.missing = targetVampiricTouch_Missing\n    myActionsData.vampiricTouch.target.expiring = targetVampiricTouch_Expiring\n    \n    return true\n    \nend\n\n\n\n",
