et and then scan for others\n    if UnitExists(\"target\") and UnitCanAttack(\"player\", \"target\") and not UnitIsDead(\"target\")     \n    --and select(4,UnitDetailedThreatSituation(\"player\", \"target\")) ~= nil    \n    then\n        checkTarget(\"target\")\n    end\n    \n    --Use Targets identified in unitsInMelee aura instead of repeating code here\n    for unit,_ in pairs(unitsInMelee.units) do\n        if UnitGUID(\"target\") ~= UnitGUID(unit)\n        then            \n            checkTarget(unit)\n        end\n    end    \n    \n    --SpellName\n    myActionsData.SpellName.missing = countSpellName_Missing   \n    myActionsData.SpellName.expiring = countSpellName_Expiring\n    myActionsData.SpellName.target.missing = targetSpellName_Missing\n    myActionsData.SpellName.target.expiring = targetSpellName_Expiring        \n    \n    return true\n    \nend",
