					["custom"] = "myEnergy = {}\n\n\ncFunction_GetEnergyCoolDowns = function(req_energey) \n    \n    local energy = UnitPower(\"player\",3)\n    \n    if energy >= req_energey\n    then\n        myEnergy[req_energey] = nil\n        \n        print(\"Bypass\")\n        \n        return 0,0\n    end\n    \n    if myEnergy[req_energey] ~= nil and myEnergy[req_energey].expirationTime < GetTime()\n    then\n        myEnergy[req_energey] = nil\n    end\n    \n    if myEnergy[req_energey] == nil\n    then\n        \n        local regen = GetPowerRegen()\n        local duration = req_energey / regen        \n        \n        local expirationTime = ((req_energey - energy) / regen) + GetTime()\n        \n        myEnergy[req_energey] = {\n            [\"duration\"] = duration,\n            [\"expirationTime\"] = expirationTime\n        }\n        \n    end  \n    \n    --print(\"Duration: \"..myEnergy[req_energey].duration..\" Expire: \"..myEnergy[req_energey].expirationTime)\n    \n    return myEnergy[req_energey].duration, myEnergy[req_energey].expirationTime\nend",
