 or unitsInRange.count < 4) and not myActions[\"Pyroblast\"].casting.active) and    \n    (not combustion and ((pc_stacks == 2 or (pc_expirationTime <= buffExpire and pc_expirationTime > castTime)) or not hotStreak))\n    then        \n        myActions[\"Pyroblast\"].priority = 5\n        aura_env.icon = 451169\n    elseif hotStreak \n    then        \n        if        \n        --Flame Strike\n        (flamestrike and \n            ((not combustion and (unitsInRange.count >= 4 or (flamePatch and unitsInRange.count >= 2)))                \n                or combustion and (unitsInRange.count >= 6 or (flamePatch and unitsInRange.count >= 3)))   \n        )\n        then\n            aura_env.icon = 135826\n            myActions[\"Pyroblast\"].priority = 5 \n        elseif (myActions[\"Fireball\"].casting.active or combustion)        \n        then\n            aura_env.icon = 135808\n            myActions[\"Pyroblast\"].priority = 5             \n        end \n    end    \n    \n    --return isAuraHighestPriority(\"Pyroblast\", myActions)    \n    if highestPriority ~= nil and highestPriority.action == \"Pyroblast\"\n    then\n        return true        \n    end        \nend\n\n\n\n",
