				{
					["trigger"] = {
						["type"] = "custom",
						["custom"] = "function()\n    \n    if isAuraHighestPriority == nil then return false end    \n    \n    --priority \n    local trashUsed_State = WeakAuras.GetTriggerStateForTrigger(\"Bloodtalons\", 4)\n    local rakeUsed_State = WeakAuras.GetTriggerStateForTrigger(\"Bloodtalons\", 5)\n    local shredUsed_State = WeakAuras.GetTriggerStateForTrigger(\"Bloodtalons\", 6)\n    local swipeUsed_State = WeakAuras.GetTriggerStateForTrigger(\"Bloodtalons\", 7)   \n    local brutalSlashUsed_State = WeakAuras.GetTriggerStateForTrigger(\"Bloodtalons\", 8)\n    local moonFireUsed_State = WeakAuras.GetTriggerStateForTrigger(\"Bloodtalons\", 9)\n    \n    myActions[\"Bloodtalons\"].priority = nil\n    if select(1,AuraUtil.FindAuraByName(\"Bloodtalons\", \"player\", \"HELPFUL|PLAYER\")) == nil\n    and GetShapeshiftForm() == 2\n    then\n        --Trash first if multi targerts\n        if unitsInMelee.count >= 3 and myActionsData.trash.missing + myActionsData.trash.expiring >= 3 and attackMode ~= \"Focus\"\n        then\n            --Trash first if multi target\n            aura_env.icon = 451161\n            myActions[\"Bloodtalons\"].priority = 8 \n        elseif cFunction_HasTalent(\"Brutal Slash\") and unitsInMelee.count >= 2 and attackMode ~= \"Focus\" \n        and IsUsableSpell(\"Brutal Slash\") and not brutalSlashUsed_State[\"\"] and select(1,GetSpellCharges(\"Brutal Slash\")) > 0        \n        then\n            -- Brutal Slash if multi target        \n            aura_env.icon = 132141\n            myActions[\"Bloodtalons\"].priority = 8 \n        elseif not cFunction_HasTalent(\"Brutal Slash\") and unitsInMelee.count >= 2 and attackMode ~= \"Focus\" \n        and IsUsableSpell(\"Swipe\") and not swipeUsed_State[\"\"]\n        then\n            --Swipe if multi target\n            aura_env.icon = 134296\n            myActions[\"Bloodtalons\"].priority = 8\n        elseif unitsInMelee.count >= 3 and myActionsData.trash.target.missing + myActionsData.trash.target.expiring >= 1 \n        and IsUsableSpell(\"Thrash\") and not trashUsed_State[\"\"]\n        then\n            --Thrash if target needs it in multi target dispite other targets needs\n            aura_env.icon = 451161\n            myActions[\"Bloodtalons\"].priority = 8                \n        elseif myActionsData.rake.target.missing + myActionsData.rake.target.expiring >= 1 and not rakeUsed_State[\"\"]\n        then\n            --Rake if target needs it\n            aura_env.icon = 132122\n            myActions[\"Bloodtalons\"].priority = 8\n        elseif cFunction_HasTalent(\"Lunar Inspiration\") and myActionsData.moonfire.target.missing + myActionsData.moonfire.target.expiring >= 1 \n        and not moonFireUsed_State[\"\"]\n        then\n            --Moonfire if target needs it\n            aura_env.icon = 136096\n            myActions[\"Bloodtalons\"].priority = 8            \n        elseif cFunction_HasTalent(\"Brutal Slash\") and IsUsableSpell(\"Brutal Slash\") and not brutalSlashUsed_State[\"\"] \n        and select(1,GetSpellCharges(\"Brutal Slash\")) > 0        \n        then\n            -- Brutal Slash on single targert        \n            aura_env.icon = 132141\n            myActions[\"Bloodtalons\"].priority = 8             \n        elseif unitsInMelee.count ~= nil and unitsInMelee.count <= 1        \n        and IsUsableSpell(\"Shred\") and not shredUsed_State[\"\"]\n        then\n            --Shred if on single targert        \n            aura_env.icon = 136231\n            myActions[\"Bloodtalons\"].priority = 8\n        elseif not cFunction_HasTalent(\"Brutal Slash\") and IsUsableSpell(\"Swipe\") and not swipeUsed_State[\"\"]\n        then\n            --Swipe if any number of targets\n            aura_env.icon = 134296\n            myActions[\"Bloodtalons\"].priority = 8\n        elseif IsUsableSpell(\"Thrash\") and not trashUsed_State[\"\"]\n        then\n            --Thrash least impactful dot so its ok if duration is cliped \n            --Also do it here cause next few rules require finding off targets to apply dots\n            aura_env.icon = 451161\n            myActions[\"Bloodtalons\"].priority = 8            \n        elseif myActionsData.rake.missing + myActionsData.rake.expiring >= 1 and not rakeUsed_State[\"\"]\n        then\n            --Rake if another target needs it(Good Luck finding it in time)\n            aura_env.icon = 132122\n            myActions[\"Bloodtalons\"].priority = 8\n        elseif cFunction_HasTalent(\"Lunar Inspiration\") and myActionsData.moonfire.missing + myActionsData.moonfire.expiring >= 1 \n        and not moonFireUsed_State[\"\"]\n        then\n            --Moonfire if another target needs it(Good Luck finding it in time)\n            aura_env.icon = 136096\n            myActions[\"Bloodtalons\"].priority = 8                         \n        elseif unitsInMelee.count ~= nil and unitsInMelee.count > 1\n        and IsUsableSpell(\"Shred\") and not shredUsed_State[\"\"]\n        then\n            --Shred if absolutly needed in multi target\n            aura_env.icon = 136231\n            myActions[\"Bloodtalons\"].priority = 8\n        elseif IsUsableSpell(\"Rake\") and not rakeUsed_State[\"\"]\n        then\n            --Rake if absolutly needed as last measure\n            aura_env.icon = 132122\n            myActions[\"Bloodtalons\"].priority = 8            \n        end\n    end\n    \n    if highestPriority ~= nil and highestPriority.action == \"Bloodtalons\"\n    then\n        return true        \n    end     \nend\n\n\n",
