ftForm() == 2\n    then    \n        if unitsInMelee.count >= 5\n        then\n            myActions[\"Brutal Slash\"].priority = 10                                              \n        else\n            myActions[\"Brutal Slash\"].priority = 13\n        end \n    else\n        myActions[\"Brutal Slash\"].priority = nil\n    end     \n    \n    if highestPriority ~= nil and highestPriority.action == \"Brutal Slash\"\n    then\n        return true        \n    end     \nend\n\n\n\n\n\n",
