			["customText"] = "function()    \n    if myActionsData ~= nil\n    then        \n        return\n        \"---FireBall---\" \n        .. \"\\nCount: \" .. myActionsData.fireBall.count\n        .. \"\\nSkip: \" .. myActionsData.fireBall.skip\n        .. \"\\nTarget: \" .. myActionsData.fireBall.target        \n        ..\"---Scorch---\" \n        .. \"\\nCount: \" .. myActionsData.scorch.count\n        .. \"\\nSkip: \" .. myActionsData.scorch.skip\n        .. \"\\nTarget: \" .. myActionsData.scorch.target        \n    end    \nend",
