			["customText"] = "function()    \n    if myActionsData ~= nil\n    then        \n        return        \n        \"---Execute---\"   \n        .. \"\\nCount: \" .. myActionsData.execute.count\n        .. \"\\nTarget: \" .. myActionsData.execute.target   \n        ..\"\\n---Rend---\"\n        .. \"\\nMissing: \" .. myActionsData.rend.missing        \n        .. \"\\nExpiring: \" .. myActionsData.rend.expiring        \n        .. \"\\nTaret Missing: \" .. myActionsData.rend.target.missing\n        .. \"\\nTarget Expiring: \" .. myActionsData.rend.target.expiring         \n    end    \nend",
			["yOffset"] = -253.4000854492188,
