						["type"] = "custom",
						["subeventSuffix"] = "_CAST_START",
						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["custom"] = "function() \n    \n    if unitsInMelee == nil or cFunction_UnitStrength == nil or cFunction_HasTalent == nil then return false end\n    \n    \n    --Min Enemey Health to make dot worthwhile, uses player health to simplify scaling\n    local playerMaxHealth = UnitHealthMax(\"player\")                             \n    local healthTreshhold_rend = playerMaxHealth / 2                                  \n    \n    if GetNumSubgroupMembers() > 0\n    then\n        healthTreshhold_rend = healthTreshhold_rend * 2               \n    end \n    \n    --Execute\n    local countExecute = 0\n    local targetExecute = 0    \n    --Rend\n    local countRend_Missing = 0\n    local countRend_Expiring = 0\n    local targetRend_Missing = 0\n    local targetRend_Expiring = 0    \n    \n    local checkTarget = function(unit)\n        local target = false\n        if UnitExists(\"target\") and UnitGUID(\"target\") == UnitGUID(unit)\n        then\n            target = true\n        end                \n        local health = UnitHealth(unit)\n        local max_health = UnitHealthMax(unit) \n        local strength = cFunction_UnitStrength(unit)         \n        \n        --Execute--\n        local multiplier =.2\n        if cFunction_HasTalent(\"Massacre\")\n        then\n            multiplier = .35\n        end        \n        \n        if health < (max_health * multiplier)         \n        then\n            countExecute = countExecute + 1\n            if target then targetExecute = 1 end                       \n        end      \n        \n        --Rend--\n        if (strength ~= \"Weak\" and health >= healthTreshhold_rend) or (strength == \"Dummy\")\n        then\n            do             \n                local name, icon, count, debuffType, duration, expirationTime, unitCaster, canStealOrPurge, nameplateShowPersonal, spellId, canApplyAura, isBossDebuff, isCastByPlayer, nameplateShowAll, timeMod = AuraUtil.FindAuraByName(\"Rend\", unit, \"HARMFUL|PLAYER\")\n                if not name\n                then                \n                    countRend_Missing = countRend_Missing + 1                           \n                    if target then targetRend_Missing = 1 end                    \n                elseif expirationTime ~= nil and expirationTime - GetTime() <= 14 *.3\n                then\n                    countRend_Expiring = countRend_Expiring + 1                                           \n                    if target then targetRend_Expiring = 1 end\n                end\n            end        \n        end\n        \n    end   \n    \n    --Always check target and then scan for others\n    if UnitExists(\"target\") and UnitCanAttack(\"player\", \"target\") and not UnitIsDead(\"target\")     \n    --and select(4,UnitDetailedThreatSituation(\"player\", \"target\")) ~= nil    \n    then\n        checkTarget(\"target\")\n    end\n    \n    for i = 1, 40 do\n        local unit = \"nameplate\"..i            \n        if WeakAuras.CheckRange(unit, 8, \"<=\")\n        and UnitCanAttack(\"player\", unit) and not UnitIsDead(unit)\n        and (select(4,UnitDetailedThreatSituation(\"player\", unit)) ~= nil and (UnitGUID(\"target\") ~= UnitGUID(unit)))\n        and not string.match(select(1,UnitName(unit), \"Totem\")) and not string.match(select(1,UnitName(unit), \"totem\"))        \n        then\n            checkTarget(unit)\n        end                \n    end             \n    \n    myActionsData.execute.count = countExecute\n    myActionsData.execute.target = targetExecute    \n    --Rend\n    myActionsData.rend.missing = countRend_Missing   \n    myActionsData.rend.expiring = countRend_Expiring\n    myActionsData.rend.target.missing = targetRend_Missing\n    myActionsData.rend.target.expiring = targetRend_Expiring     \n    \n    return true\n    \nend\n\n\n\n",
