rity = 11\n        end        \n    elseif myActions[\"Mind Blast\"].casting.active\n    then        \n        myActions[\"Mind Blast\"].priority = nil\n    end    \n    \n    if highestPriority ~= nil and highestPriority.action == \"Mind Blast\"\n    then\n        return true        \n    end    \nend\n\n\n\n\n",
